import styled from "styled-components";

const A = styled.a`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    text-align: center;
`

function Links(props) {
    return (
        <>
            {props.text === props.tarifas && props.subtarifas.map((t, k) => <a>{t}</a>)}
        </>)

}

export default Links;
